import React from 'react';
import { AppBar, Toolbar, Typography, Switch, FormControlLabel } from '@mui/material';
import RestaurantIcon from '@mui/icons-material/Restaurant';
import LocalHospitalIcon from '@mui/icons-material/LocalHospital';

const Header = ({ mode, setMode }) => {
  return (
    <AppBar position="static" color="primary">
      <Toolbar>
        {mode === 'restaurant' ? (
          <RestaurantIcon sx={{ mr: 2 }} />
        ) : (
          <LocalHospitalIcon sx={{ mr: 2 }} />
        )}
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          {mode === 'restaurant' ? 'Smart Restaurant Assistant' : 'Smart Clinic Assistant'}
        </Typography>
        <FormControlLabel
          control={
            <Switch
              checked={mode === 'clinic'}
              onChange={() => setMode(mode === 'restaurant' ? 'clinic' : 'restaurant')}
              color="default"
            />
          }
          label={mode === 'restaurant' ? 'Switch to Clinic' : 'Switch to Restaurant'}
        />
      </Toolbar>
    </AppBar>
  );
};

export default Header;
